import {Component} from '@angular/core';
import {ActivatedRoute} from "@angular/router";
import {EventsService} from "../../services/events.service";
import {EventModel} from "../../models/event.model";

@Component({
  selector: 'app-editevent',
  templateUrl: './editevent.component.html',
  styleUrls: ['./editevent.component.css']
})
export class EditeventComponent {

  eventDetails: EventModel = {
    id: "",
    eventId: '0',
    eventTitle: '0',
    eventDescription: '0',
    eventPrice: 1,
    eventVariations: '0',
    eventImage: '',
    eventStartDate: new Date('0'),
    eventEndDate: new Date('0'),
    eventNumberOfTicketAvailable: 0,
    eventCreatedById: '0',
  }

  constructor(private route: ActivatedRoute, private eventsService: EventsService) {

  }

  ngOnInit(): void {
    this.route.paramMap.subscribe({
      next: (params) => {
        const id = params.get("id");
        if (id) {
          this.eventsService.getEvent(id).subscribe({
            next: (response) => {
              this.eventDetails = response;

              console.log(this.eventDetails);
            },error:(err)=>{console.log(err)}
          });
        }
      }
    })
  }

  onSubmit() {
    this.eventsService.updateEvent(this.eventDetails.id, this.eventDetails).subscribe({
      next: (response) => {
        console.log(response)
      },error:(e)=>{
        console.log(e)
      }
    });
  }

}

<div class="container">
  <h2>Edit Event</h2>
  <form (ngSubmit)="onSubmit()" #editEventForm="ngForm">
    <div class="form-group">
      <label for="eventTitle">Event Title</label>
      <input type="text" class="form-control" id="eventTitle" name="eventTitle" [(ngModel)]="eventDetails.eventTitle" required>
    </div>
    <div class="form-group">
      <label for="eventDescription">Event Description</label>
      <textarea class="form-control" id="eventDescription" name="eventDescription" [(ngModel)]="eventDetails.eventDescription" required></textarea>
    </div>
    <div class="form-group">
      <label for="eventPrice">Event Price</label>
      <input type="number" class="form-control" id="eventPrice" name="eventPrice" [(ngModel)]="eventDetails.eventPrice" required>
    </div>
    <div class="form-group">
      <label for="eventStartDate">Event Start Date</label>
      <input type="date" class="form-control" id="eventStartDate" name="eventStartDate" [(ngModel)]="eventDetails.eventStartDate" required>
    </div>
    <div class="form-group">
      <label for="eventEndDate">Event End Date</label>
      <input type="date" class="form-control" id="eventEndDate" name="eventEndDate" [(ngModel)]="eventDetails.eventEndDate" required>
    </div>
    <div class="form-group">
      <label for="eventNumberOfTicketAvailable">Available Tickets</label>
      <input type="number" class="form-control" id="eventNumberOfTicketAvailable" name="eventNumberOfTicketAvailable" [(ngModel)]="eventDetails.eventNumberOfTicketAvailable" required>
    </div>
    <div class="form-group">
      <label for="eventImage">Event Image URL</label>
      <input type="text" class="form-control" id="eventImage" name="eventImage" [(ngModel)]="eventDetails.eventImage">
    </div>
    <button type="submit" class="btn btn-primary">Update Event</button>
  </form>
</div>
